     &   (2*(sqrt2*(m12*Sub720(All4,Cha4,Cha5,Ind1,Ind2)) + 
     &        1/2.D0*(S2B*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &           Sub734(All4,Cha4,Cha5,Ind1,Ind2))))/S2B

        Sub736(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   AaC0i80(Epsi(cc0),All4,Cha4,Cha5)*
     &     Sub726(All4,Cha4,Cha5,Ind1,Ind2) + 
     &    AaC0i80(Epsi(cc2),All4,Cha4,Cha5)*
     &     Sub731(All4,Cha4,Cha5,Ind1,Ind2) + 
     &    AaC0i80(Epsi(cc1),All4,Cha4,Cha5)*
     &     Sub735(All4,Cha4,Cha5,Ind1,Ind2)

	ENDLOOP(All4)
	ENDLOOP(Cha4)
	ENDLOOP(Cha5)
	ENDLOOP(Ind1)
	ENDLOOP(Ind2)

	LOOP(Ind4, 1,3,1)
	LOOP(Ind3, 1,3,1)
	LOOP(Ind2, 1,3,1)
	LOOP(Ind1, 1,3,1)
	LOOP(Cha4, 1,2,1)
	LOOP(All5, 1,6,1)
	LOOP(All4, 1,6,1)

        Sub655(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub633(All5,Cha4,Ind1)*Sub653(All4,All5,Ind3,Ind4)*
     &         Sub654(All4,Cha4,Ind2) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub650(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub666(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub633(All5,Cha4,Ind1)*Sub654(All4,Cha4,Ind2)*
     &         Sub665(All4,All5,Ind3,Ind4) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub662(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub667(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub655(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub666(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub672(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub633(All5,Cha4,Ind1)*Sub654(All4,Cha4,Ind2)*
     &         Sub671(All4,All5,Ind3,Ind4) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub668(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub673(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (-(3*cI*(CW*SB*Sub672(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &           XHiggs(hno,3,uzext1))) + 
     &      TB*Sub667(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))/
     &    (CW*SB*TB)

        Sub674(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub633(All5,Cha4,Ind1)*Sub653(All4,All5,Ind3,Ind4)*
     &         Sub654(All4,Cha4,Ind2) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub650(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub675(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub633(All5,Cha4,Ind1)*Sub654(All4,Cha4,Ind2)*
     &         Sub665(All4,All5,Ind3,Ind4) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub662(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub676(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub674(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub675(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub677(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub633(All5,Cha4,Ind1)*Sub654(All4,Cha4,Ind2)*
     &         Sub671(All4,All5,Ind3,Ind4) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub668(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

        Sub678(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (-(3*cI*(CW*SB*Sub677(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &           XHiggs(hno,3,uzext1))) + 
     &      TB*Sub676(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))/
     &    (CW*SB*TB)

        Sub679(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   m3*AaC0i16(Epsi(cc2),All4,All5,Cha4)*
     &     Sub673(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &    m2*AaC0i16(Epsi(cc1),All4,All5,Cha4)*
     &     Sub678(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)

	ENDLOOP(All4)
	ENDLOOP(All5)
	ENDLOOP(Cha4)
	ENDLOOP(Ind1)
	ENDLOOP(Ind2)
	ENDLOOP(Ind3)
	ENDLOOP(Ind4)

	end

